import React from "react";
import { Navbar, Nav, Button } from "react-bootstrap";
import Jumbotron from "react-bootstrap/Jumbotron";
import "../../Styling/LandingPage2.css";
import logo from "../../Images/star.png";

class LandingPage extends React.Component {
  render() {
    // let landingStyle = {
    //   width: "auto",
    //   height: "auto",
    //   margin: "auto"
    // };
    // <div className="background-pic" />;
    // style={landingStyle}

    // <Navbar bg={this.props.color}  variant="dark">

    return (
      <div>
        <ul className="twitter" role="navigation">
          <li>
            <i className="fas fa-home" />
            Home
          </li>
          <li>
            <i className="fas fa-bell-o" />
            Notifications
          </li>
          <li>
            <i className="fas fa-envelope-o" />
            Messages
          </li>
          <li>
            <i className="fas fa-twitter" />
          </li>
          <li>
            <form>
              <input placeholder="search twitter" />
              <i className="fas fa-search" />
            </form>
          </li>
          <li>
            <i className="fas fa-user-circle-o" />
          </li>
          <li>
            <button>tweet</button>
          </li>
        </ul>
      </div>
    );
  }
}

export default LandingPage;
